package com.rabbit.solution.easy;

import java.util.HashMap;
import java.util.Map;

public class Solution242 {
    public static boolean isAnagram(String s, String t) {
        Map<String, Integer> sMap = new HashMap();
        Map<String, Integer> tMap = new HashMap();
        for (int i = 0; i < s.length(); i++) {
            String temp = s.substring(i, i + 1);
            if (sMap.get(temp) == null) {
                sMap.put(temp, 1);
            } else {
                sMap.put(temp, sMap.get(temp) + 1);
            }
        }

        for (int i = 0; i < t.length(); i++) {
            String temp = t.substring(i, i + 1);
            if (tMap.get(temp) == null) {
                tMap.put(temp, 1);
            } else {
                tMap.put(temp, tMap.get(temp) + 1);
            }
        }

        if (sMap.size() != tMap.size()) {
            return false;
        }

        for (Map.Entry<?, ?> entry : sMap.entrySet()) {
            if (tMap.get(entry.getKey()) != null && tMap.get(entry.getKey()).equals(entry.getValue())) {
                continue;
            } else {
                return false;
            }
        }

        return true;
    }

    public static void main(String[] args) {
        //String test = "";
        //String test2 = "";
        String test = "a";
        String test2 = "b";
        System.out.println(isAnagram(test, test2));
    }
}
